import React, { useState } from "react";
import { useLocation } from "react-router-dom";
import NewspaperLayout from "./layouts/NewspaperLayout";

const BookAd = () => {
  const location = useLocation();
  const { newspaperId, newspaperName, spaceId } = location.state || {};

  const [selectedNewspaper, setSelectedNewspaper] = useState(newspaperName || "");
  const [adContent, setAdContent] = useState("");

  const handleNewspaperChange = (event) => {
    setSelectedNewspaper(event.target.value);
  };

  const calculatePrice = () => {
    if (!selectedNewspaper) {
      alert("Please select a newspaper first.");
      return;
    }
    const pricePerWord = selectedNewspaper === "The Virtual Times" ? 10 : 8;
    const wordCount = adContent.split(" ").filter((word) => word).length;
    const totalPrice = pricePerWord * wordCount;
    alert(`Total Price: ₹${totalPrice}`);
  };

  const proceedToPayment = () => {
    if (!selectedNewspaper || !adContent.trim()) {
      alert("Please select a newspaper and enter ad content before proceeding.");
      return;
    }
    alert(`Proceeding to payment with:\nNewspaper ID: ${newspaperId}\nNewspaper: ${selectedNewspaper}\nSpace ID: ${spaceId}`);
  };

  return (
    <div style={styles.bookAdContainer}>
      <div style={styles.bookAdBox}>
        <h2 style={styles.heading}>Book Your Ad</h2>

        {/* Newspaper Dropdown */}
        <label style={styles.label}>Select a Newspaper:</label>
        <select
          onChange={handleNewspaperChange}
          value={selectedNewspaper}
          style={styles.newspaperSelect}
        >
          <option value="">-- Select --</option>
          <option value="The Virtual Times">The Virtual Times - ₹10 per word</option>
          <option value="Daily News">Daily News - ₹8 per word</option>
        </select>

        {selectedNewspaper && (
          <div style={styles.newspaperLayoutContainer}>
            <NewspaperLayout name={selectedNewspaper} />
          </div>
        )}

        {/* Ad Content Textarea */}
        <label style={styles.label}>Enter Ad Content:</label>
        <textarea
          placeholder="Type your ad content here..."
          value={adContent}
          onChange={(e) => setAdContent(e.target.value)}
          style={styles.textarea}
        />

        {/* Buttons */}
        <div style={styles.bookAdButtons}>
          <button style={styles.button} onClick={calculatePrice}>
            Calculate Price
          </button>
          <button style={styles.button} onClick={proceedToPayment}>
            Proceed to Payment
          </button>
        </div>
      </div>
    </div>
  );
};

// Internal CSS styles
const styles = {
  bookAdContainer: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    height: "100vh",
    backgroundColor: "#f4f4f4",
    margin: 0,
    padding: 0,
    boxSizing: "border-box",
  },
  bookAdBox: {
    width: "500px", // Wider for better alignment
    padding: "30px",
    background: "white",
    borderRadius: "12px",
    boxShadow: "0 8px 16px rgba(0, 0, 0, 0.1)",
    display: "flex",
    flexDirection: "column",
    textAlign: "center",
    boxSizing: "border-box",
  },
  heading: {
    color: "#333",
    marginBottom: "20px",
  },
  label: {
    fontWeight: "bold",
    marginBottom: "10px",
    textAlign: "left",
  },
  newspaperSelect: {
    margin: "15px 0",
    padding: "12px",
    width: "80%", // Decreased width for better alignment
    border: "1px solid #ccc",
    borderRadius: "8px",
    boxSizing: "border-box",
    alignSelf: "center", // Center the dropdown
  },
  newspaperLayoutContainer: {
    marginTop: "20px",
  },
  textarea: {
    margin: "15px 0",
    padding: "12px",
    width: "100%",
    border: "1px solid #ccc",
    borderRadius: "8px",
    boxSizing: "border-box",
    resize: "none",
  },
  bookAdButtons: {
    marginTop: "20px",
    display: "flex",
    justifyContent: "space-between",
  },
  button: {
    backgroundColor: "#007bff",
    color: "white",
    border: "none",
    padding: "12px 20px",
    borderRadius: "8px",
    cursor: "pointer",
    transition: "background 0.3s ease",
  },
  buttonHover: {
    backgroundColor: "#0056b3",
  },
};

export default BookAd;
